import 'package:redis/redis.dart';

import '../check.dart';

class redis {
  List<dynamic> allKeys = [];
  List<List<dynamic>> values = [];

  static Future<redis> readAll() async {
    redis returnVal = redis();
    final values = await getSignIn();
    final conn = RedisConnection();
    await conn
        .connect(values["where"], values["port"])
        .then((Command command) async {
      await command.send_object(
          ["AUTH", values["username"], values["pass"]]).then((_) async {
        await command.send_object([
          "KEYS",
          "*",
        ]).then((var response) async => {
              returnVal.allKeys = response,
              if (response is List)
                {
                  for (var i in response)
                    {
                      await command
                          .send_object(["LRANGE", i, 0, -1]).then((var all) {
                        returnVal.values.add(all);
                      })
                    }
                }
            });
      });
    });
    return returnVal;
  }

  static Future<List<dynamic>> readOneKey(String where) async {
    List<dynamic> returnVal = [];
    final values = await getSignIn();
    final conn = RedisConnection();
    await conn
        .connect(values["where"], values["port"])
        .then((Command command) async {
      await command.send_object(
          ["AUTH", values["username"], values["pass"]]).then((_) async {
        await command.send_object(["LRANGE", where, 0, -1]).then((var all) {
          returnVal = all;
        });
      });
    });
    return returnVal;
  }
}

import 'package:shared_preferences/shared_preferences.dart';

Future<bool> check() async {
    final prefs = await SharedPreferences.getInstance();
    final String? pas =prefs.getString('redis_pass');
    final String? key = prefs.getString('redis_username');
    final String? url = prefs.getString('redis_location');
    final int? port = prefs.getInt('redis_port');
    if (pas == null || key == null || url == null || port == null) {
        return false;
    } else {
        return true;
    }
}

Future<void> newSignIn(
    String pass, String username, String where, String port) async {
  final prefs = await SharedPreferences.getInstance();
  prefs.setString('redis_location', where);
  prefs.setString('redis_pass', pass);
  prefs.setString('redis_username', username);
  prefs.setInt('redis_port', int.parse(port));
}

Future<Map<String, dynamic>> getSignIn() async {
  final prefs = await SharedPreferences.getInstance();
  final String? pass = prefs.getString('redis_pass');
  final String? username = prefs.getString('redis_username');
  final String? where = prefs.getString('redis_location');
  final int? port = prefs.getInt('redis_port');
  if (pass == null || username == null || where == null || port == null) {
    throw "null error";
  }
  return {
    'pass': pass,
    'username': username,
    'where': where,
    'port': port,
  };
}

