      })
  );
});

procedure TDecompressionMiddleware.OnBeforeControllerAction
  (AContext: TWebContext; const AControllerQualifiedClassName,
  AActionNAme: string; var AHandled: Boolean);
var
  ContentEncoding: string;
  ContentBytes: TBytes;
  ContentString: string;
begin
  ContentBytes := AContext.Request.RawWebRequest.RawContent;
  ContentString := TEncoding.UTF8.GetString(ContentBytes);
  ContentString := DecompressString(ContentString, TMVCCompressionType.ctGZIP);
  ContentBytes := TEncoding.UTF8.GetBytes(ContentString);
  // Next line causes a compiler error "Can not assign to a read-only property"
  // AContext.Request.RawWebRequest.RawContent := ContentBytes;
end;
 
function DecompressString(const AText: string; ACompressionType: TMVCCompressionType): string;
var
  SourceStream,
  TargetStream: TStringStream;
  Unzipper: TZDecompressionStream;
begin
  Result := '';
  SourceStream := TStringStream.Create(AText);
  TargetStream := TStringStream.Create;
  try
    Unzipper := TZDecompressionStream.Create(SourceStream,
      MVC_COMPRESSION_ZLIB_WINDOW_BITS[ACompressionType], False);
    try
      TargetStream.CopyFrom(Unzipper, Unzipper.Size);
    finally
      Unzipper.Free;
    end;
    Result := TargetStream.DataString;
  finally
    SourceStream.Free;
    TargetStream.Free;
  end;
end;

/// <summary>
/// Loads sctex file into loaded helper structure
/// </summary>
/// <param name="filename">Filename</param>
/// <returns>Pointer to HelperImageData </returns>
LoaderSctex::HelperImageData* LoaderSctex::Load(const std::string& filename)
{
	if (!Files::Exists(filename))
	{
		mLog->Print("LoaderSctex", std::string("File ") + filename + std::string(" does not exist!"));
		return nullptr;
	}

	HelperImageData* image = new HelperImageData();

	FILE* f = fopen(filename.c_str(), "rb");

	fread(&image->mHeader, sizeof(Header), 1, f);

	image->mImageRecord = new ImageRecord[image->mHeader.mNumImages];

	fread(image->mImageRecord, sizeof(ImageRecord), image->mHeader.mNumImages, f);

	image->mImageData = new ImageData[image->mHeader.mNumImages];

	for (size_t i = 0; i < image->mHeader.mNumImages; i++)
	{
		image->mImageData[i].mData = new unsigned char[image->mImageRecord[i].mSize];

		fseek(f, (long)image->mImageRecord[i].mOffset, SEEK_SET);
		fread(image->mImageData[i].mData, sizeof(char), image->mImageRecord[i].mSize, f);
	}

	fclose(f);

	return image;
}

